import React from "react";

const todoList = ({todos, setTodos}) => {
    return (
        <div>
            {todos.map((todo) => (
                <li className="todo-list" key={todo.id}>
                    <input
                        type= "text"
                        value={todo.title}
                        className = "list"
                        onChange={(e) => e.preventDefault()}
                    />
                </li>                
        ))}
        </div>
    )
}
export default todoList
